import React from 'react';


class PdfParse extends React.Component {

   // No state is created yet, don't need constructor() yet
    constructor() {
      super();
      this.state = {
         text: "Test",
      }

   }

   submitPDF() {
      alert("where is your pdf");
      this.setState({text: this.state.text})
   }

   render() {
      return (
         <div>
            <header className="App">
            <h1>BidScope.IO</h1>
            </header>
            <div className="App-header">
               <h2>Upload Your Plans</h2>
               <button onClick={this.submitPDF}>Click to Upload</button>
               <p>{this.text}</p>
            </div>
          </div>
      );
   }
}



export default PdfParse;
